import React, { Component } from 'react';
import { NavLink } from 'react-router-dom';
import { Butt } from '../components/Butt';
import { Head3 } from '../styles/Head3';
import { Head4 } from '../styles/Head4';
import { FaThinkPeaks, FaThList, FaStackExchange, FaPoll} from 'react-icons/fa';
import Titl from '../components/Titl';
import AnsI from '../components/AnsI';

import CreM from '../components/CreM';
import CreQ from '../components/CreQ';
import CreS from '../components/CreS';
import NavC from '../components/NavC';

import { Switch, Route, BrowserRouter } from 'react-router-dom';
import 'bootstrap/dist/css/bootstrap.min.css';


import uuid from 'uuid';

export default class Crea extends Component {
	render() {

	    return (
	      <BrowserRouter>
	        <div>      
	          <NavC />
	          <Switch>
		        <Route exact path="/CreM" activeClassName="active" component={CreM} exact={true} />  
	            <Route path="/CreQ"   component={CreQ} /> 
	            <Route path="/CreS"   component={CreS} />
	          </Switch> 	                
	        </div>
	      </BrowserRouter>

	    );
  	}	
}
